import React from "react";
class Auth extends React.Component {
  render() {
    return (
      <section>
        <form className="form">
          <section className="form__container">
            <h1 className="form__lable">Username</h1>
            <input type="text" className="userName" name="userName" />
            <h1 className="form__lable">Password</h1>
            <input type="password" className="password" name="password" />
            <button className="submit">Войти</button>
          </section>
        </form>
      </section>
    );
  }
}

export default Auth;
